import ReactDOM from "react-dom/client";

import {
  Route,
  createBrowserRouter,
  RouterProvider,
  createRoutesFromElements,
} from "react-router-dom";
import React from "react";
import Home from "./Home";
import SobreNosotros from "./SobreNosotros/SobreNosotros";
import MiCuenta from "./MiCuenta/MiCuenta";
import AgendarCita from "./AgendarCita/AgendarCita";

//Creacion de las rutas de nuestro proyecto
//las rutas se insertan dentro de un array,dicho array se enviara al routerProvider
const router = createBrowserRouter(
  createRoutesFromElements([
    <Route path="/" element={<index />}>
      <Route path="/home" element={<Home />} />,
      <Route path="/sobreNosotros" element={<SobreNosotros />} />,
      <Route path="/miCuenta" element={<MiCuenta />} />,
      <Route path="/AgendarCita" element={<AgendarCita />} />,
    </Route>,
  ])
);

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <RouterProvider router={router} />
  </React.StrictMode>
);
